// contracts/DecentralizedJobBoard.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

contract DecentralizedJobBoard {
    uint public jobCount;
    address public owner;

    struct Job {
        uint id;
        string title;
        string description;
        uint budget;
        uint duration;
        address employer;
        address freelancer;
        bool fundsEscrowed;
        bool paymentReleased;
    }

    mapping(uint => Job) public jobs;
    mapping(uint => uint) public escrowedAmounts;

    event JobPosted(uint indexed jobId, address indexed employer, string title, uint budget);
    event JobApplied(uint indexed jobId, address indexed freelancer);
    event PaymentReleased(uint indexed jobId, address indexed freelancer, uint amount);
    event EmployerRefunded(uint indexed jobId, address indexed employer, uint amount);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    function postJob(
        string memory _title,
        string memory _description,
        uint _budget,
        uint _duration
    ) public onlyOwner {
        require(_budget > 0, "Budget must be greater than 0");
        jobCount++;
        jobs[jobCount] = Job(
            jobCount,
            _title,
            _description,
            _budget,
            _duration,
            msg.sender,
            address(0),
            false,
            false
        );
        emit JobPosted(jobCount, msg.sender, _title, _budget);
    }

    function escrowFunds(uint _jobId) public payable onlyOwner {
        Job storage job = jobs[_jobId];
        require(msg.value == job.budget, "Must send exact budget amount");
        require(!job.fundsEscrowed, "Funds already escrowed");

        job.fundsEscrowed = true;
        escrowedAmounts[_jobId] = msg.value;
    }

    function applyForJob(uint _jobId) public {
        Job storage job = jobs[_jobId];
        require(job.freelancer == address(0), "Job already has applicant");
        require(job.fundsEscrowed, "Employer must escrow funds first");

        job.freelancer = msg.sender;
        emit JobApplied(_jobId, msg.sender);
    }

    function releasePayment(uint _jobId) public onlyOwner {
        Job storage job = jobs[_jobId];
        require(job.freelancer != address(0), "No freelancer assigned");
        require(!job.paymentReleased, "Payment already released");

        uint amount = escrowedAmounts[_jobId];
        payable(job.freelancer).transfer(amount);

        job.paymentReleased = true;
        emit PaymentReleased(_jobId, job.freelancer, amount);
    }

    function getJobCount() public view returns (uint) {
        return jobCount;
    }
}
